import React, { Component } from 'react';
import './styles/App.css';


export default class App extends Component {
  //créer une fonction récupérer les produites 
  render() {
    return (
      <div className="App">
        <header className="App-header">
        <h1>Produits</h1>
          <div>
          <li>Produit1</li>
          <li>Produit2</li>
          <li>Produit3</li>
          <li>Produit4</li>
          </div>
        </header>
      </div>
    );
  }
}
